import React from "react";
import crossicon from "../images/crossicon.png";

function QuizPublishedPopup() {
  return (
    <div
      style={{
        paddingBottom: "2vh",
        paddingTop: "2vh",
        paddingRight: "2.5vw",
        paddingLeft: "2.5vw",
        marginLeft: "3vw",
        backgroundColor: "white",
        borderRadius: "10px",
        width: "70vw",
      }}
    >
      <div style={{ textAlign: "right", marginRight: "-1.5vw" }}>
        <img src={crossicon} alt="crossicon" />
      </div>

      <div
        style={{
          textAlign: "center",
          color: "#474444",
          fontSize: "2em",
          fontWeight: "600",
          marginTop: "2vh",
        }}
      >
        <p>Congrats your Quiz is </p>
        <p>Published!</p>
      </div>

      <div>
        <input
          style={{
            backgroundColor: "#EDEDED",
            color: "#474444",
            border: "none",
            borderRadius: "10px",
            marginTop: "2vh",
            marginLeft: "2vw",
            height: "6vh",
            width: "35vw",
          }}
        ></input>
      </div>
    </div>
  );
}

export default QuizPublishedPopup;
